import React from "react";
function Spage() {
  return (
    <div>
      <div class="card bg-dark text-white">
        <img
          src={asimg}
          class="card-img"
          alt="..."
          style={{ height: "220px" }}
        ></img>
        <div class="card-img-overlay">
          

          <Link to="/Spage">
            <button type="button" class="btn btn-warning">
              Sign-up
            </button>{" "}
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Spage;
